@everyone the election results stand! Congratulations to @Nayn //, @Sathimus Prime, @ultrapara, @Steelhead, and @vacasean. We have an exciting path ahead and cannot wait to get to work with the newly elected EPs.

A massive thank you to @Sentiens, @Kalos, @cerebrous, @mick, @Grug, and @sgtsKill for all of the hard work in our foundational year.

Onward and upward 🫡.

