@everyone EPs just ratified Bulletin 2301 - see the latest post in #🗳│emissary-votes for details. **With this update, quorum for community votes is 11%**. For a reminder on how Emissary votes are ratified or rejected, check out https://docs.echelon.io/echelon-prime-foundation/4.0-governance/4.2-bulletins/emissary-votes.

In the last few days, two governance proposals were submitted on http://echelon.io/governance. Join us tomorrow at 7pm EST for a community call to discuss. In the call, we will determine whether a community or Emissary vote makes sense for each proposal. We will record the call and post a summary for those who cannot make it.

